import { combineReducers } from 'redux';

import { authConstants } from '../constants';
import { authentication } from './auth.reducer';
import { validation } from './validator.reducer';
import { registration } from './registration.reducer';
import { users } from './users.reducer';
import {questions} from './questions.reducer'
import { alert } from './alert.reducer';
import { post } from './post.reducer';
import { myPosts } from './mypost.reducer';
import { search } from './search.reducer';
import { home } from './home.reducer';
import { shoppingCart } from './shoppingCart.reducer';
import { watchList } from './watchList.reducer';
import { auction } from './auction.reducer';
import { biddingHistory } from './biddingHistory.reducer';
import { order } from './order.reducer';
import { moneyWithdrawal } from './moneyWithdrawal.reducer';
import { servicePoint } from './servicePoint.reducer'
import { returnRequests } from './returnRequests.reducer'
import { badges } from './badges.reducer'
import { faqs } from './faq.reducer';
import { contactUs } from './contactUs.reducer';
import { reportProblem } from './reportProblem.reducer';
import { voucher } from './voucher.reducer';
import { avatar } from './avatar.reducer';
import { categories } from './categories.reducer';
import { termsandConditions } from './termsandconditions.reducer';
import { registerReducer } from './register.reducer';
import {keepInTouch} from './keepInTouch.reducer'


const appReducer = combineReducers({
  authentication,
  validation,
  registration,
  users,
  questions,
  alert,
  post,
  myPosts,
  home,
  search,
  shoppingCart,
  order,
  watchList,
  auction,
  biddingHistory,
  moneyWithdrawal,
  servicePoint,
  returnRequests,
  badges,
  faqs,
  contactUs,
  reportProblem,
  voucher,
  avatar,
  categories,
  termsandConditions,
  registerReducer,
  keepInTouch
});

const rootReducer = (state, action) => {
  if (action.type === authConstants.LOGOUT) {
    state = undefined;
  }
  return appReducer(state, action)
}

export default rootReducer;
